import { useState } from 'react'
import TokenContext, { initialTokenState, TokenContextState } from '../contexts/TokenContext'
import AssetTokenTypes from '../enums/AssetTokenType';

const TokenProvider: React.FC = (props) => {
  const [state, setState] = useState<TokenContextState>(initialTokenState);

  setState({
    ...state,
    tokenlist: [
      {
        tokenName: "ELA001",
        image: AssetTokenTypes.COMMERCIAL,
        marketSize: 564654,
        totalBorrowed: 23423,
        depositApy: 293,
        borrowApr: 192
      },
      {
        tokenName: "ELA002",
        image: AssetTokenTypes.RESIDENTIAL,
        marketSize: 23123,
        totalBorrowed: 23123,
        depositApy: 442,
        borrowApr: 20
      },
      {
        tokenName: "ELA003",
        image: AssetTokenTypes.COMMERCIAL,
        marketSize: 11,
        totalBorrowed: 22,
        depositApy: 33,
        borrowApr: 44
      },
    ]
  })

  return (
    <TokenContext.Provider value={{
      ...state
    }}>
      {props.children}
    </TokenContext.Provider>
  );
}

export default TokenProvider;
